import React, { Component } from 'react';
import {Route} from 'react-router-dom';
import Profile from './Profile';
import Home from './Home';
import Nav from './Nav';
import Auth from './Auth/Auth';

class App extends Component {
  constructor(props){
    super(props);
    this.auth=new Auth(this.props.history);
  }
  render() {
    return (
      <>
        <Nav/>
          <div className="body">
          <Route path="/" 
          exact 
          render={<Home auth={this.auth} {...this.props} />}
          />
          <Route 
          path="/profile" 
          render={<Profile auth={this.auth} {...this.props}/>}  
          />
          </div>
      </>
    );
  }
}

export default App;
